import React from 'react';
import Accordion from './components/Accordion';

const items = [
  {
    title: 'what is React?',
    content: 'react is a front-end javascript framework',
  },
  {
    title: 'why use React?',
    content: 'react is a front-end javascript framework',
  },
  {
    title: 'what my mouse always doesnt work?',
    content: 'react is a front-end javascript framework',
  },
];

const App = () => {
  return (
    <div className="ui container">
      <Accordion items={items} />
    </div>
  );
};

export default App;
